import React, { Component } from "react";

class Home extends Component {
  render() {
    return (
        <section id="Home" className="py-10 px-3 bg-amber-300 h-screen">
        <div className="bg-gray-700 px-8 rounded-2xl py-5 lg:max-w-4xl mx-auto min-h-[24rem] mt-20  gap-6 lg:flex-row flex-col-reverse items-center">
          <div className="flex flex-col justify-center items-center">
            <h2 className="text-2xl font-semibold text-white ">
              Aplicativo de Reservas
            </h2>
            <div className="flex flex-row justify-center items-center">
            <button className="btn-primary mt-10">Realizar Reserva</button>
            <button className="btn-primary mt-10">Lista de Reservas</button>
            </div>
          </div>
          <img
            src="./images/loeffa.png"
            alt=""
            className="P-10 flex items-end justify-end"
          />
        </div>
      </section>
    );
  }
}

export default Home;
